import './App.css';
import Login from "./components/Login";
import Footer from "./components/Footer";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <Login />
        <Footer />
      </header>
    </div>
  );
}

export default App;
